import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Nav, Navbar, Container } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

function NavbarComp() {
    const nav = useNavigate()
    const [username, setUsername] = useState("")

    useEffect(() => {
        axios.get("http://140.116.214.154:3000/api/data/username")
        .then(res => {
            setUsername(res.data)
        }).catch(res => {
        })
    }, [])

    function logout(e){
        e.preventDefault()

        axios.get("http://140.116.214.154:3000/api/user/logout")
        .then(res => {
            alert("Logout")
            nav("/login")
        }).catch(res => {
            alert("something error, please try again")
        })
    }

    return (
        <div>
            <Navbar bg = "dark" variant = "dark" expand = "lg">
                <Container fluid>
                    <Navbar.Brand href = "/home">Financial</Navbar.Brand>
                    <Navbar.Toggle aria-controls = "basic-navbar-nav" />
                    <Navbar.Collapse id =" basic-navbar-nav">
                        <Nav className = "me-auto">
                            <Nav.Link href = "/database">個股綜合資料</Nav.Link>
                            <Nav.Link href = "/2">個股推薦</Nav.Link>
                            <Nav.Link href = "/3">Line memo</Nav.Link>
                            <Nav.Link href = "/calendar">Calendar</Nav.Link>
                            <Nav.Link href = "/5">Meeting data</Nav.Link>
                            <Nav.Link href = "/6">Plot</Nav.Link>
                            <Nav.Link href = "/7">產業分析上傳</Nav.Link>
                            <Nav.Link href = "/8">個人檔案</Nav.Link>
                        </Nav>

                        <div className = 'd-flex'>
                            <p className = 'text-center my-auto' style = {{ color : "white" }}>{username}您已經登入囉 &emsp;</p>
                            <button className = "btn btn-outline-light" data-bs-toggle="modal" data-bs-target="#exampleModal">登出</button>
                        </div>
                    </Navbar.Collapse>
                </Container>
            </Navbar>

            <div class="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div class="modal-dialog">
                    <div class="modal-content">
                    <div class="modal-header">
                        <h5 class="modal-title" id="exampleModalLabel">Modal title</h5>
                        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                    </div>
                    <div class="modal-body">
                        dwqdwqdwq
                    </div>
                    <div class="modal-footer">
                        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                        <button type="button" class="btn btn-primary">Save changes</button>
                    </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default NavbarComp;
